import './master.css';
import Equipo from "./Equipo";

class Equipos extends React.Component {

state = { equipos : []};

componentDidMount() {
    this.setState({ equipos: [{ nombre: "Los gladiadores", bandera: "/images/bandera-azul.png", color: "azul", integrantes: [ { nombre: "Mick Jagger"}, { nombre: "Michael Jackson"}]}, 
    { nombre: "Somos Unicos", color: "amarillo", bandera: "/images/bandera-amarilla.png"
, integrantes: [ { nombre: "Juan Perez"}, { nombre: "Pablo Lopez"}]},
   { nombre: "Geniales", color: "verde", bandera: "/images/bandera-verde.png"
, integrantes: [ { nombre: "Juan Perez"}, { nombre: "Pablo Lopez"}]}, 
   { nombre: "Los mejores", color: "rojo", bandera: "/images/bandera-roja.png", integrantes: []}
    ]});
 //  { nombre: "Los mejores", color: "rojo", bandera: "/images/bandera-roja.png", integrantes: [ { nombre: "Juan Perez"}, { nombre: "Pablo Lopez"}]}]});
	             }


render() { 

  return (  
            <div className="App">
              <div className="banner-container">
              <img src="/images/map_banner.png"/>
                <div className="banner-text">Hackathon blablabla</div>
              </div>
	      <p className="map-title" align="center">EQUIPOS</p>
	      <img src="/images/linea1.png"/>
	      <br/>
	      <div className="warrior"><img src="/images/warrior.png"/></div>
	      <div className="grupoEquipos">
	       { 
		  this.state.equipos.map((equipo) => {
                return <Equipo equipo={equipo}/> })
	       }
	      </div>

     </div>
  )

}

}     


export default Equipos;
